import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SettingsService {
  private rowsPerColumns: number = 144;

  constructor() { }

  setRowsPerColumns(rows: number){
    this.rowsPerColumns = rows;
  }

  getRowsPerColumns(): number {
    return this.rowsPerColumns
  }

}
